<script lang="ts">
  export let loading: boolean = false;
  export let tenant: string = "";

  if (loading) {
    this.renderer.setStyle(document.body, "overflow", "hidden");
  } else {
    this.renderer.removeStyle(document.body, "overflow");
  }
</script>

<style lang="scss">
  @import "./styles.scss";
</style>

<svelte:options tag="sura-loading" />
{#if loading}
  <div class="custom-modal-message_backdrop" />
  <div class="custom-modal-message__container">
    {#if tenant !== 'sura'}
      <div class="material-preloader-wrapper mb-4">
        <div class="spinner-layer">
          <div class="circle-clipper spinner-layer_left">
            <div class="circle-clipper__circle" />
          </div>
          <div class="gap-patch">
            <div class="gap-patch__circle" />
          </div>
          <div class="circle-clipper spinner-layer_right">
            <div class="circle-clipper__circle" />
          </div>
        </div>
      </div>
    {/if}

    {#if tenant === 'sura'}
      <div>
        <img
          src="data:image/gif;base64," />
      </div>
    {/if}
    <p class="custom-modal-message__message">Cargando...</p>
  </div>
{/if}
